(25, 'Kannan CB', NULL, NULL, NULL, 'I bought a battery recently. Excellent service from them. They are also doing some mechanic work to ensure the customer satisfaction', '0622202212383162b30d470fbf7New Project (2).jpg', NULL, 'Approved', 'admin', '2022-06-22 16:38:31', NULL),
(26, 'Masudh Ayub Ansar', NULL, NULL, NULL, 'Good Services, have never experienced services with mobile app., your timely response & commitment will guide you achieving greater heights! Wish you all Success.', '0622202212411962b30def31d66masufu.jpg', NULL, 'Approved', 'admin', '2022-06-22 16:41:19', NULL),
(27, 'Vijayan Vlogs', NULL, NULL, NULL, 'Excellent service from xps battery store. Customer service also superb and very quickly. I always prefer xps battery stores for my all battery related services..', '0622202212440462b30e94d25eavijayan.jpg', NULL, 'Approved', 'admin', '2022-06-22 16:44:04', NULL),
(28, 'Neelgiri Tarpaulins - Salem', NULL, NULL, NULL, 'I have been customer of Xps battery store for the past six years . Quality of product nd customer service is fast nd more reliable .', '0622202212461362b30f15db15cneelgiri.jpg', NULL, 'Approved', 'admin', '2022-06-22 16:46:13', NULL),
(29, 'Muthu Muthaiyan', NULL, NULL, NULL, 'Very best batteries and services. No other options for better results. XPS is the only perfect company with good service and with good products', '0622202212482562b30f9928353muthu.jpg', NULL, 'Approved', 'admin', '2022-06-22 16:48:25', NULL),
(30, 'Vijay Viju', NULL, NULL, NULL, 'Ranganathan co battery check point Mr.Sakthi   performance and service is very useful for me  low price and good quality battery', '0622202212504662b31026c1089vijaya.jpg', NULL, 'Approved', 'admin', '2022-06-22 16:50:46', NULL),
(31, 's.amar nath', NULL, NULL, NULL, 'I have given old battery for charging and changed one battery for bike in less price and service is awesome thanks to samsudeen for coordinating me.', '0622202212531462b310ba6d0ceamaran.jpg', NULL, 'Approved', 'admin', '2022-06-22 16:53:14', NULL),
(32, 'KRISHNAMOORTHI K', NULL, NULL, NULL, 'Very best batteries and services. No other options for better results. XPS is the only perfect company with good service and with good products', '0622202212562162b31175dbb54kirshnamoorty.jpg', NULL, 'Approved', 'admin', '2022-06-22 16:56:21', NULL),
(20, 'Srirangamani S', NULL, NULL, NULL, 'I actually was referred by my friend and it turned out to be the best deal i had in Salem (compared to other major leading dealers).Best quality and a very very competitive price with a friendly doorstep service.\r\nAll the best and thanks to the owner!', '0622202207381462b2c6e63ba1dphoto.jpg', NULL, 'Approved', 'admin', '2022-06-22 11:31:28', '2022-06-22 11:38:14'),
(21, 'Jagan Venkatachalam', NULL, NULL, NULL, 'Customer handling is good.product wise i am using 1st time but product review i will update once usage.(i have purchased in ponkaaliyamman petrol pump)', '0622202207451562b2c88b4f5bcjagan.jpg', NULL, 'Approved', 'admin', '2022-06-22 11:45:15', NULL),
(22, 'Murali KM', NULL, NULL, NULL, 'Quick door step service with knowledgeable technicians. I got a good deal from XPS replacing my computer ups battery with buy back deal and great satisfaction on safe disposal of old battery as a reponsible citizen.', '0622202207482762b2c94be0158jagan (1).jpg', NULL, 'Approved', 'admin', '2022-06-22 11:48:27', '2022-06-22 16:30:53'),
(24, 'Joseph Raj', NULL, NULL, NULL, 'I strongly recommend everyone to take the service of XPS battery for all your battery needs. The company is very professional and their service is prompt. You don\'t have to worry if you have got any breakdown of cars due to battery problem.', '0622202212324962b30bf17b6c4New Project (1).jpg', NULL, 'Approved', 'admin', '2022-06-22 16:32:49', NULL),
(23, 'Cube3 Events', NULL, NULL, NULL, 'Easily accessible... genuine store... not money motive if its really needed to replace they will suggest ... otherwise same battery is repaired and fitted. Junk start is excellent- on time service . I recommend XPS battery store', '0622202207510162b2c9e5dc326logo.jpg', NULL, 'Approved', 'admin', '2022-06-22 11:51:01', '2022-06-22 11:51:46');
